30	\N	\N	Trilha Pirá-Brasília no Parque Ecológico da Candangolândia		<p>Local: Parque Ecológico e pela cidade&nbsp;Candangolândia. Distância: 4,5km. Tempo de Caminhada: 1h30. Características: trilha eco urbana Pirá-Brasília faz alusão à espécie endêmica de peixe que está na lista dos animais vulneráveis à extinção e que foi descoberto pela primeira vez no córrego Guará, numa área pertencente ao contexto geográfico da Candangolândia. Localizada na cidade mãe de Brasília, Candangolândia, a trilha tem como principal objetivo evidenciar e valorizar o patrimônio ambiental e sócio-histórico deste território, além de resgatar uma relação harmônica entre os comunitários e a natureza. Neste sentido, a trilha tem parte do seu percurso dentro do Parque Ecológico e Vivencial da Candangolândia. A trilha segue em zona urbana passando por pontos que revelam a historicidade do ambiente: 1ª Olaria de Brasília, 1ª Escola Pública de Brasília, 1ª Igreja de Brasília, Praça da Bíblia, 1ª Sede da Novacap, Caixa Forte, 1º Restaurante Comunitário de Brasília (SAPS), Praça dos Estados (Ponto de chegada dos pioneiros), Rua do Sossego, 1º Núcleo de Custódia de Brasília.</p>	1	Candangolândia	0	\N	f	f	t
