46	2019-05-29 20:40:45+00	\N	Trilha de Bike no Parque Ecológico Dom Bosco (Ermida)		Local: Parque Ecológico Dom Bosco (Ermida). Distância: 12km.&nbsp;Duração média: 2 a 3h.&nbsp;Ponto Zero: Estacionamento do Parque&nbsp;(Ermida). Recomendação: Capacete, óculos e luvas. Descrição: trilha para bike na região da Ermida Dom Bosco, em área que integra Parque Ecológico Dom Bosco localizado à beira do Lago Paranoá. O percurso&nbsp;é iniciado no estacionamento do Parque e retorna às margens do Lago Paranoá outras três vezes, alternando subidas e descidas para atingi-las.\nBoa parte do percurso passa em pequenas estradas de terra e single tracks em meio à vegetação local. Também passa por trechos de asfalto, com trânsito de veículos, onde deve-se utilizar, quando existentes, as áreas de terra nas laterais da via. Possui trechos com pedras, rochas e cascalho, exigindo atenção e habilidade do ciclista para transpor o terreno.\nOutro ponto que requer atenção refere-se à navegação, sendo importante o uso da PNR ou GPS com tracklog do percurso e rádio. Esses aspectos justificam a classificação da trilha como MÉDIA. Um dos melhores pontos para o banho está no km 10 (ponto 32 da PNR), em que a trilha contorna um pequeno trecho da margem do Lago. Atenção nesse local, pois a trilha é acidentada, sendo necessário carregar a bike em alguns trechos que, dependendo das chuvas e do controle da barragem, passam por dentro da água.	1	Lago Sul	1	\N	f	f	t
