or paisagístico, cultural, místico e gastronômico – segue pelo contorno do PNB, Lago Oeste, a Serrinha do Paranoá e a Rota do Cavalo, tendo, ao longo do caminho, diversos espaços para vivência espiritual, boa alimentação e contatos com manifestações culturais. Passa pela Torre Digital, símbolo dos Caminhos do Planalto Central.<br>\n <br>	9	Brasília	2	\N	f	t	f
